import './App.css';
import Login from './components/Login';
import ReactDOM from "react-dom";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Link } from "react-router-dom";
import Connecte from './components/Connecte';
import Signup from './components/Signup';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

      <nav class="navbar navbar-expand-lg navbar-light bg-light">
          <div class="container-fluid">
            <a class="navbar-brand" href="#">Machine Learning</a>
            <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
              <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarNav">
              <ul class="navbar-nav">
                <li class="nav-item">
                  <Link to="/" class="nav-link">Login</Link>
                </li>
                <li class="nav-item">
                  <Link to="/facedetection" class="nav-link">Face Detection</Link>
                </li>
                <li class="nav-item">
                  <Link to="/objectron" class="nav-link">Objectron</Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/home" element={<Connecte />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
